import React from "react";
import "@popperjs/core";
import 'bootstrap/dist/css/bootstrap.min.css';
import SelectPage from './selectPage';
import './Reservation.css';
import Radio from './radio';
import RadioGroup from './radioGroup';
import axios from "axios";

class Reservation extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            // name: props.name,
            // pet: props.pet  // 저장 내용 표시 여부
        };
    }
    
    // componentDidMount() {
    //     const token = 'Bearer eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzUxMiJ9.eyJzdWIiOiJjb3PthqDtgbAiLCJpZCI6MSwiZXhwIjoxNjkyNzg1NzE4LCJ1c2VybmFtZSI6Imtha2FvXzI4OTgyMDI5NDQifQ.yFK4TqoT7I2ckMp-pQAytO5vg_IjPr1A3co2iAZMU1OJFkt1H0J2ZxGFSP4Tm-2hnwmvo1OljdxXJCyrHq25Tw';
       
    //     axios.get('/userInfo', {
    //         headers: {
    //             Authorization: `${token}`
    //         }
    //     },[])
    //         .then(response => {
    //             // API 요청 성공 시 처리
    //             console.log('API Response:', response.result);
    //         })
    //         .catch(error => {
    //             // API 요청 실패 시 처리
    //             console.log('API Error:', error);
    //         });
    // }
    
    handleNextClick = () => {
        this.setState({ showSelectPage: true });
    };
    handleShowDetails = () => {
        this.setState({ showDetails: true });
    };
    render() {
        const { showDetails, showSelectPage } = this.state;

    
        if (showSelectPage) {
            return <SelectPage />;
        }

        return (
            <div className="main_R">
                <div className="ment">
                    <p className="detail">예약상세</p>
                    <a className="save" href="#"  onClick={this.handleShowDetails}>저장내용불러오기</a>
                </div>
                
                <div className="table_box">
                    <table className="table tablee"  >
                        <thead>
                            <tr>
                                <th scope="col" style={{ background: '#F5F5F5', width: 213 }}>반려동물 이름</th>
                                <th scope="col" style={{width:277}}>{showDetails && (<p>{this.props.petName}</p>)}</th>
                                <th scope="col" style={{ background: '#F5F5F5', width:344 }}>이름</th>
                                <th scope="col"style={{width:277}}>{showDetails && (<p>{this.props.name}</p>)}</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <th scope="row" style={{ background: '#F5F5F5' }}>반려동물 종류</th>
                                <td>{showDetails && (<p>{this.props.species}</p>)}</td>
                                <td style={{ background: '#F5F5F5' }}>전화번호</td>
                                <td>{showDetails && (<p>{this.props.telephone}</p>)}</td>
                            </tr>
                            <tr>
                                <th scope="row" style={{ background: '#F5F5F5' }}>반려동물 성별</th>
                                <td>{showDetails && (<p>{this.props.gender}</p>)}</td>
                                <td style={{ background: '#F5F5F5' }}>주소</td>
                                <td>{showDetails && (<p>{this.props.address}</p>)}</td>
                            </tr>
                            <tr>
                                <th scope="row" rowSpan="3" style={{ background: '#F5F5F5' }}>메뉴선택</th>
                                <td colSpan="3">

                                    <RadioGroup>
                                        <Radio name="species" value="small" >중,소형견</Radio>
                                        <Radio name="species" value="big">대형견</Radio>
                                    </RadioGroup>


                                </td>
                            </tr>

                            <tr>
                                <td colSpan="3">
                                    <RadioGroup>
                                        <Radio name="cut" value="1" >가위컷</Radio>
                                        <Radio name="cut" value="2">기계컷</Radio>
                                        <Radio name="cut" value="3">스포팅</Radio>
                                        <Radio name="cut" value="4" >클리핑</Radio>
                                        <Radio name="cut" value="5" >부분미용</Radio>
                                    </RadioGroup>
                                </td>
                            </tr>

                            <tr>
                                <td colSpan="3">
                                    <RadioGroup>
                                        <Radio name="bath" value="bagic" >목욕</Radio>
                                        <Radio name="bath" value="healing">힐링스파</Radio>
                                        <Radio name="bath" value="carbonic acid">탄산스파</Radio>
                                    </RadioGroup>
                                </td>
                            </tr>
                        </tbody>
                    </table>
                </div>
                
                <button className="next" onClick={this.handleNextClick}>다음</button>
            </div>

        )
    }

}


export default Reservation;
